import { useEffect } from 'react';
import React from 'react';
import './App.css';

function App() {
  const url = 'https://63f4e22355677ef68bc5fb32.mockapi.io/emoji';
  useEffect(() => { 
    fetch(url)
    .then((res)=>res.json())
  })
  return (
    <input type="text" placeholder='Найти свой эмоджи...' />
  );
}

export default App;
